import React from 'react'

const renderRecipes = () => {
    fetch('http://localhost:3000/recipes')
        .then(r => r.json())
        .then(recipes => {
            console.log(recipes)
        })
}

function RecipeContainer() {
    return (
        <div>
            <h1>This is the recipe container</h1>
            {renderRecipes()}
        </div>
    )
}

export default RecipeContainer
